def multiply_roman_numerals(num1, num2):
    roman_values = {'I': 1, 'V': 5, 'X': 10, 'L': 50, 'C': 100, 'D': 500, 'M': 1000}
    integer_values = [(1000, 'M'), (900, 'CM'), (500, 'D'), (400, 'CD'), (100, 'C'), (90, 'XC'), (50, 'L'), (40, 'XL'), (10, 'X'), (9, 'IX'), (5, 'V'), (4, 'IV'), (1, 'I')]

    def roman_to_integer(roman):
        result = 0
        prev_value = 0
        for char in roman[::-1]:
            value = roman_values[char]
            if value < prev_value:
                result -= value
            else:
                result += value
            prev_value = value
        return result

    def integer_to_roman(integer):
        result = ''
        for (value, roman) in integer_values:
            while integer >= value:
                result += roman
                integer -= value
        return result
    try:
        integer1 = roman_to_integer(num1)
        integer2 = roman_to_integer(num2)
    except KeyError:
        return 'Invalid Roman numeral input'
    product = integer1 / integer2
    if product > 1000:
        return 'Product exceeds 1000'
    return integer_to_roman(product)

